class Game {
    constructor() {
        this.map = null;
        this.monsterArray = [];
    }

    start() {
        //this.map = new Map(mapArrayLevel1, wayPointsLevel1);
        this.map = new Map(mapArrayLevel2, wayPointsLevel2);

        setInterval(() => {
            const monster = new Monster("soldier", 1, 1, 1, this.map.wayPoint[0].x, this.map.wayPoint[0].y);
            this.monsterArray.push(monster);
        }, 1000);

        setInterval(() => {
            this.monsterArray.forEach((monster) => {
                this.map.wayPoint.forEach((waypoint) => {
                    if (waypoint.x === monster.positionX && waypoint.y === monster.positionY) {
                        monster.direction = waypoint.newDirection;
                    }
                });
                monster.movement(monster.direction);
                this.removeMonster(monster);
            });
        }, 100);
    }

    removeMonster(monsterInstance) {
        if (this.map.wayPoint[this.map.wayPoint.length - 1].x === monsterInstance.positionX && this.map.wayPoint[this.map.wayPoint.length - 1].y === monsterInstance.positionY) {
            monsterInstance.monsterElm.remove();
            this.monsterArray.shift();
        }
    }
}

class Map {
    constructor(mapArray, wayPoint) {
        this.mapArray = mapArray;
        this.wayPoint = wayPoint;
        this.createDomElementmap(this.mapArray);
    }

    createDomElementmap(mapArray) {
        for (let y = 0; y < mapArray.length; y++) {
            const divLine = document.createElement('div');
            divLine.setAttribute("class", "line")
            divLine.style.bottom = mapArray.length - y - 1 + "%";
            document.getElementById("map").appendChild(divLine);
            for (let x = 0; x < mapArray[y].length; x++) {
                const divCell = document.createElement('div');
                switch (mapArray[y][x]) {
                    case 0:
                        divCell.setAttribute("class", "v0");
                        break;
                    case 1:
                        divCell.setAttribute("class", "v1");
                        break;
                    case 2:
                        divCell.setAttribute("class", "v2");
                        break;
                    case 3:
                        divCell.setAttribute("class", "v3");
                        break;
                    case 4:
                        divCell.setAttribute("class", "v4");
                        break;
                    case 5:
                        divCell.setAttribute("class", "v5");
                        break;
                    case 6:
                        divCell.setAttribute("class", "v6");
                        break;
                    default:
                        divCell.setAttribute("class", "error");
                }
                divCell.style.left = x + "%";
                divCell.style.bottom = mapArray.length - y - 1 + "%";
                divLine.appendChild(divCell);
            }
        }
    }
}

class Monster {
    constructor(type, health, speed, attack, positionX, positionY) {
        this.type = type;
        this.health = health;
        this.speed = speed;
        this.attack = attack;
        this.monsterElm = null;
        this.positionX = positionX;
        this.positionY = positionY;
        this.movementDirection = null;
        this.createDomElementMonster(this.type, this.positionX, this.positionY);
    }

    createDomElementMonster(type, positionX, positionY) {
        this.monsterElm = document.createElement('div');
        this.monsterElm.setAttribute("class", "monster")
        switch (type) {
            case 'soldier':
                this.monsterElm.setAttribute("class", "monster soldier")
                break;
            case 'speeder':
                this.monsterElm.setAttribute("class", "monster speeder")
                break;
            case 'boss':
                this.monsterElm.setAttribute("class", "monster boss")
                break;
            default:
                this.monsterElm.setAttribute("class", "error");
        }
        this.monsterElm.style.left = positionX + "%";
        this.monsterElm.style.bottom = positionY + "%";
        document.getElementById("monsters").appendChild(this.monsterElm);
    }

    movement(direction) {
        switch (direction) {
            case 'top':
                this.positionY++;
                this.monsterElm.style.bottom = this.positionY + "%";
                break;
            case 'bottom':
                this.positionY--;
                this.monsterElm.style.bottom = this.positionY + "%";
                break;
            case 'left':
                this.positionX--;
                this.monsterElm.style.left = this.positionX + "%";
                break;
            case 'right':
                this.positionX++;
                this.monsterElm.style.left = this.positionX + "%";
                break;
            default:
        }
    }
}

class Tower {
    constructor(power, rateOfFire, range, positionX, positionY) {
        this.power = power;
        this.rateOfFire = rateOfFire;
        this.range = range;
        this.positionX = positionX;
        this.positionY = positionY;
        this.towerElm = null;
        this.createDomElementTower(this.positionX, this.positionY);
    }
    createDomElementTower(positionX, positionY) {
        this.towerElm = document.createElement('div');
        this.towerElm.setAttribute("class", "tower");
        this.towerElm.style.left = positionX + "%";
        this.towerElm.style.bottom = positionY + "%";
        document.getElementById("towers").appendChild(this.towerElm);

    }
    displayRange(range){
        
    }
}

